import treePer from "@/components/treePermission";
export default {
  components: {
    treePer: treePer
  },
  data: function data() {
    return {
      // url传参账户id及userId
      user_id: '',
      _id: '',
      // 是否全选
      topChecked: false,
      // 列表数据
      tableData: [],
      // 数据权限
      dataAuthList: [{
        name: '个人',
        authType: 0
      }, {
        name: '部门',
        authType: 1
      }, {
        name: '部门及以下',
        authType: 2
      }, {
        name: '机构',
        authType: 3
      }]
    };
  },
  created: function created() {
    this.user_id = this.$route.query.userId;
    this._id = this.$route.query.id;
  },
