    var _this = this;

    this.$nextTick(function () {
      _this.getData();
    });
  },
  methods: {
    // 后退
    routerback: function routerback() {
      this.$router.go(-1);
    },
    // 获取数据
    getData: function getData() {
      var _this2 = this;

      this.request(this.api.system.user_Auth_Tree, {
        userId: this.user_id
      }).then(function (data) {
        _this2.tableDataInit(data);

        _this2.tableData = data;
        _this2.topChecked = data.findIndex(function (f) {
          return f.checked;
        }) > -1;
      });
    },
    tableDataInit: function tableDataInit(data) {
      var _this3 = this;

      if (data && data.length) {
        data.forEach(function (item) {
          if (item.leaf) {
            var dataAuthChecked = item.sublist.find(function (item) {
              return item.type === 'dataAuth';
            });

            if (dataAuthChecked) {
              item._dataAuthChecked = dataAuthChecked.authType;
            } else {
              item._dataAuthChecked = 0;
            }

            item.sublist = item.sublist.filter(function (item) {
              return item.type === 'auth';
            });
            item._dataAuthList = _this3.dataAuthList.map(function (auth) {
              return {
                name: auth.name,
                authType: auth.authType,
                menuId: item.id
              };
            });
          } else {
            _this3.tableDataInit(item.sublist);
          }
        });
      }
    },
    // 返回权限设置是否全选
    treeChange: function treeChange(topChecked) {
      var hasChecked = this.tableData.findIndex(function (f) {
        return f.checked;
      }) > -1;

      if (hasChecked) {
        this.topChecked = hasChecked;
      } else {
        this.topChecked = topChecked;
      }
    },
