        menuList: perDa.menus,
        authList: perDa.ops,
        dataAuthList: perDa.dataAuthList
      };
      this.request(this.api.user.crm_userCompany_saveUserAuth, postDa).then(function (data) {
        _this4.routerback();
      });
    },
    // 获取参数权限设置参数
    combinaParams: function combinaParams() {
      var list = this.tableData;
      var allList = {
        menus: [],
        ops: [],
        dataAuthList: []
      };
      this.recurveData(allList, list);
      return allList;
    },
    recurveData: function recurveData(allList, list) {
      var _this5 = this;

      list.forEach(function (f) {
        if (f.leaf) {
          var dataAuth = f._dataAuthList.find(function (item) {
            return item.authType === f._dataAuthChecked;
          });

          allList.dataAuthList.push(dataAuth);
        }

        if (f.checked) {
          switch (f.type) {
            case "menu":
              allList.menus.push(f.id);
              break;

            case "auth":
              allList.ops.push(f.id);
              break;
          }
        }

        if (f.sublist && f.sublist.length > 0) {
          _this5.recurveData(allList, f.sublist);
        }
      });
    },
    // 功能权限全选
    perChange: function perChange(val) {
      var _this6 = this;

      this.tableData.forEach(function (f) {
        f.checked = val;

        if (f.sublist && f.sublist.length > 0) {
          _this6.cbChange(f.sublist, val);
        }
      });
    },
    cbChange: function cbChange(list, checked) {
      var _this7 = this;

      list.forEach(function (f) {
        f.checked = checked;

        if (f.sublist && f.sublist.length > 0) {
          _this7.cbChange(f.sublist, checked);
        }
      });
    }
  },
